import React , { useState } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Container,
  Jumbotron,
} from 'reactstrap';


function Home() {

    const [isOpen, setIsOpen] = useState(false);
    const toggle = () => setIsOpen(!isOpen);

  return (
        <div>
            <Navbar color="info" dark expand="md">
            <Container>
        <NavbarBrand href="/">Henri Michel</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="/">Orçamento</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
        </Container>
      </Navbar>

      <Jumbotron fluid>
        <Container >
          <h1 className="display-4 text-center">Nossos consultores estão prontos para lhe ajudar!</h1>
          <p className="lead text-center">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
        </Container>
      </Jumbotron>
        </div>
  
  );
}

export default Home;
